import{_ as e,o as a,c as i,ag as r}from"./chunks/framework.rAhUSuuf.js";const m=JSON.parse('{"title":"dart:collection","description":"API documentation for the dart:collection library","frontmatter":{"title":"dart:collection","description":"API documentation for the dart:collection library","outline":[2,3],"editLink":false,"prev":false,"next":false},"headers":[],"relativePath":"api/Dart_dart-collection/index.md","filePath":"api/Dart_dart-collection/index.md","lastUpdated":null}'),l={name:"api/Dart_dart-collection/index.md"};function o(d,t,n,s,h,c){return a(),i("div",null,[...t[0]||(t[0]=[r('<h1 id="dart-collection" tabindex="-1">dart:collection <a class="header-anchor" href="#dart-collection" aria-label="Permalink to &quot;dart:collection&quot;">​</a></h1><p>Classes and utilities that supplement the collection support in dart:core.</p><p>To use this library in your code:</p><div class="language-dart vp-adaptive-theme"><button title="Copy Code" class="copy"></button><span class="lang">dart</span><pre class="shiki shiki-themes github-light github-dark vp-code" tabindex="0"><code><span class="line"><span style="--shiki-light:#D73A49;--shiki-dark:#F97583;">import</span><span style="--shiki-light:#032F62;--shiki-dark:#9ECBFF;"> &#39;dart:collection&#39;</span><span style="--shiki-light:#24292E;--shiki-dark:#E1E4E8;">;</span></span></code></pre></div><h2 id="map" tabindex="-1">Map <a class="header-anchor" href="#map" aria-label="Permalink to &quot;Map {#map}&quot;">​</a></h2><p>A finite mapping from unique keys to their associated values. Allows efficient lookup of the value associated with a key, if any, and iterating through the individual keys and values of the map. The <a href="/api/Dart_dart-core/Map.html">Map</a> interface has a number of implementations, including the following:</p><ul><li><a href="/api/Dart_dart-collection/HashMap.html">HashMap</a> is unordered, the order of iteration is not guaranteed.</li><li><a href="/api/Dart_dart-collection/LinkedHashMap.html">LinkedHashMap</a> iterates in key insertion order.</li><li><a href="/api/Dart_dart-collection/SplayTreeMap.html">SplayTreeMap</a> iterates the keys in sorted order.</li><li><a href="/api/Dart_dart-collection/UnmodifiableMapView.html">UnmodifiableMapView</a> is a wrapper, an unmodifiable <a href="/api/Dart_dart-core/Map.html">Map</a> view of another <code>Map</code>.</li></ul><h2 id="set" tabindex="-1">Set <a class="header-anchor" href="#set" aria-label="Permalink to &quot;Set {#set}&quot;">​</a></h2><p>A collection of objects in which each object can occur only once. The <a href="/api/Dart_dart-core/Set.html">Set</a> interface has a number of implementations, including the following:</p><ul><li><a href="/api/Dart_dart-collection/HashSet.html">HashSet</a> does not guarantee the order of the objects in the iterations.</li><li><a href="/api/Dart_dart-collection/LinkedHashSet.html">LinkedHashSet</a> iterates the objects in insertion order.</li><li><a href="/api/Dart_dart-collection/SplayTreeSet.html">SplayTreeSet</a> iterates the objects in sorted order.</li><li><a href="/api/Dart_dart-collection/UnmodifiableSetView.html">UnmodifiableSetView</a> is a wrapper, an unmodifiable <a href="/api/Dart_dart-core/Set.html">Set</a> view of another <code>Set</code>.</li></ul><h2 id="queue" tabindex="-1">Queue <a class="header-anchor" href="#queue" aria-label="Permalink to &quot;Queue {#queue}&quot;">​</a></h2><p>A queue is a sequence of elements that is intended to be modified, by adding or removing elements, only at its ends. Dart queues are <em>double ended</em> queues, which means that they can be accessed equally from either end, and can therefore be used to implement both stack and queue behavior.</p><ul><li><a href="/api/Dart_dart-collection/Queue.html">Queue</a> is the general interface for queues.</li><li><a href="/api/Dart_dart-collection/ListQueue.html">ListQueue</a> is a list-based queue. Default implementation for <a href="/api/Dart_dart-collection/Queue.html">Queue</a>.</li><li><a href="/api/Dart_dart-collection/DoubleLinkedQueue.html">DoubleLinkedQueue</a> is a queue implementation based on a double-linked list.</li></ul><h2 id="list" tabindex="-1">List <a class="header-anchor" href="#list" aria-label="Permalink to &quot;List {#list}&quot;">​</a></h2><p>An indexable sequence of objects. Objects can be accessed using their position, index, in the sequence. <a href="/api/Dart_dart-core/List.html">List</a> is also called an &quot;array&quot; in other programming languages.</p><ul><li><a href="/api/Dart_dart-collection/UnmodifiableListView.html">UnmodifiableListView</a> is a wrapper, an unmodifiable <a href="/api/Dart_dart-core/List.html">List</a> view of another <code>List</code>.</li></ul><h2 id="linkedlist" tabindex="-1">LinkedList <a class="header-anchor" href="#linkedlist" aria-label="Permalink to &quot;LinkedList {#linkedlist}&quot;">​</a></h2><p><a href="/api/Dart_dart-collection/LinkedList.html">LinkedList</a> is a specialized double-linked list of elements that extends <a href="/api/Dart_dart-collection/LinkedListEntry.html">LinkedListEntry</a>. Each element knows its own place in the linked list, as well as which list it is in.</p><h2 id="section-classes" tabindex="-1">Classes <a class="header-anchor" href="#section-classes" aria-label="Permalink to &quot;Classes {#section-classes}&quot;">​</a></h2><table tabindex="0"><thead><tr><th>Class</th><th>Description</th></tr></thead><tbody><tr><td><a href="/api/Dart_dart-collection/DoubleLinkedQueue.html">DoubleLinkedQueue&lt;E&gt;</a></td><td>A <a href="/api/Dart_dart-collection/Queue.html">Queue</a> implementation based on a double-linked list.</td></tr><tr><td><a href="/api/Dart_dart-collection/DoubleLinkedQueueEntry.html">DoubleLinkedQueueEntry&lt;E&gt;</a></td><td>An entry in a doubly linked list.</td></tr><tr><td><a href="/api/Dart_dart-collection/HashMap.html">HashMap&lt;K, V&gt;</a></td><td>A hash-table based implementation of <a href="/api/Dart_dart-core/Map.html">Map</a>.</td></tr><tr><td><a href="/api/Dart_dart-collection/HashSet.html">HashSet&lt;E&gt;</a></td><td>An unordered hash-table based <a href="/api/Dart_dart-core/Set.html">Set</a> implementation.</td></tr><tr><td><s><a href="/api/Dart_dart-collection/HasNextIterator.html">HasNextIterator&lt;E&gt;</a></s></td><td><strong>Deprecated.</strong> Wrapper for <a href="/api/Dart_dart-core/Iterator.html">Iterator</a> providing the pre-Dart 1.0 iterator interface.</td></tr><tr><td><a href="/api/Dart_dart-collection/LinkedHashMap.html">LinkedHashMap&lt;K, V&gt;</a></td><td>An insertion-ordered <a href="/api/Dart_dart-core/Map.html">Map</a> with expected constant-time lookup.</td></tr><tr><td><a href="/api/Dart_dart-collection/LinkedHashSet.html">LinkedHashSet&lt;E&gt;</a></td><td>A <a href="/api/Dart_dart-collection/LinkedHashSet.html">LinkedHashSet</a> is a hash-table based <a href="/api/Dart_dart-core/Set.html">Set</a> implementation.</td></tr><tr><td><a href="/api/Dart_dart-collection/LinkedList.html">LinkedList&lt;E extends LinkedListEntry&lt;E&gt;&gt;</a></td><td>A specialized double-linked list of elements that extends <a href="/api/Dart_dart-collection/LinkedListEntry.html">LinkedListEntry</a>.</td></tr><tr><td><a href="/api/Dart_dart-collection/LinkedListEntry.html">LinkedListEntry&lt;E extends LinkedListEntry&lt;E&gt;&gt;</a></td><td>An object that can be an element in a <a href="/api/Dart_dart-collection/LinkedList.html">LinkedList</a>.</td></tr><tr><td><a href="/api/Dart_dart-collection/ListBase.html">ListBase&lt;E&gt;</a></td><td>Abstract implementation of a list.</td></tr><tr><td><a href="/api/Dart_dart-collection/ListQueue.html">ListQueue&lt;E&gt;</a></td><td>List based <a href="/api/Dart_dart-collection/Queue.html">Queue</a>.</td></tr><tr><td><a href="/api/Dart_dart-collection/MapBase.html">MapBase&lt;K, V&gt;</a></td><td>Base class for implementing a <a href="/api/Dart_dart-core/Map.html">Map</a>.</td></tr><tr><td><a href="/api/Dart_dart-collection/MapView.html">MapView&lt;K, V&gt;</a></td><td>Wrapper around a class that implements <a href="/api/Dart_dart-core/Map.html">Map</a> that only exposes <code>Map</code> members.</td></tr><tr><td><a href="/api/Dart_dart-collection/Queue.html">Queue&lt;E&gt;</a></td><td>A <a href="/api/Dart_dart-collection/Queue.html">Queue</a> is a collection that can be manipulated at both ends. One can iterate over the elements of a queue through <a href="/api/Dart_dart-core/Iterable.html#foreach">forEach</a> or with an <a href="/api/Dart_dart-core/Iterator.html">Iterator</a>.</td></tr><tr><td><a href="/api/Dart_dart-collection/SetBase.html">SetBase&lt;E&gt;</a></td><td>Base implementation of <a href="/api/Dart_dart-core/Set.html">Set</a>.</td></tr><tr><td><a href="/api/Dart_dart-collection/SplayTreeMap.html">SplayTreeMap&lt;K, V&gt;</a></td><td>A <a href="/api/Dart_dart-core/Map.html">Map</a> of objects that can be ordered relative to each other.</td></tr><tr><td><a href="/api/Dart_dart-collection/SplayTreeSet.html">SplayTreeSet&lt;E&gt;</a></td><td>A <a href="/api/Dart_dart-core/Set.html">Set</a> of objects that can be ordered relative to each other.</td></tr><tr><td><a href="/api/Dart_dart-collection/UnmodifiableListView.html">UnmodifiableListView&lt;E&gt;</a></td><td>An unmodifiable <a href="/api/Dart_dart-core/List.html">List</a> view of another List.</td></tr><tr><td><a href="/api/Dart_dart-collection/UnmodifiableMapBase.html">UnmodifiableMapBase&lt;K, V&gt;</a></td><td>Basic implementation of an unmodifiable <a href="/api/Dart_dart-core/Map.html">Map</a>.</td></tr><tr><td><a href="/api/Dart_dart-collection/UnmodifiableMapView.html">UnmodifiableMapView&lt;K, V&gt;</a></td><td>View of a <a href="/api/Dart_dart-core/Map.html">Map</a> that disallow modifying the map.</td></tr><tr><td><a href="/api/Dart_dart-collection/UnmodifiableSetView.html">UnmodifiableSetView&lt;E&gt;</a></td><td>An unmodifiable <a href="/api/Dart_dart-core/Set.html">Set</a> view of another <a href="/api/Dart_dart-core/Set.html">Set</a>.</td></tr></tbody></table><h2 id="section-extensions" tabindex="-1">Extensions <a class="header-anchor" href="#section-extensions" aria-label="Permalink to &quot;Extensions {#section-extensions}&quot;">​</a></h2><table tabindex="0"><thead><tr><th>Extension</th><th>on</th><th>Description</th></tr></thead><tbody><tr><td><a href="/api/Dart_dart-collection/IterableExtensions.html">IterableExtensions&lt;T&gt;</a></td><td>Iterable&lt;T&gt;</td><td>Operations on iterables.</td></tr><tr><td><a href="/api/Dart_dart-collection/NullableIterableExtensions.html">NullableIterableExtensions&lt;T extends Object&gt;</a></td><td>Iterable&lt;T?&gt;</td><td>Operations on iterables with nullable elements.</td></tr></tbody></table><h2 id="section-typedefs" tabindex="-1">Typedefs <a class="header-anchor" href="#section-typedefs" aria-label="Permalink to &quot;Typedefs {#section-typedefs}&quot;">​</a></h2><table tabindex="0"><thead><tr><th>Typedef</th><th>Description</th></tr></thead><tbody><tr><td><a href="/api/Dart_dart-collection/IterableBase.html">IterableBase&lt;E&gt;</a></td><td>Base class for implementing <a href="/api/Dart_dart-core/Iterable.html">Iterable</a>.</td></tr><tr><td><a href="/api/Dart_dart-collection/IterableMixin.html">IterableMixin&lt;E&gt;</a></td><td>This <a href="/api/Dart_dart-core/Iterable.html">Iterable</a> mixin implements all <a href="/api/Dart_dart-core/Iterable.html">Iterable</a> members except <code>iterator</code>.</td></tr><tr><td><a href="/api/Dart_dart-collection/ListMixin.html">ListMixin&lt;E&gt;</a></td><td>Base mixin implementation of a <a href="/api/Dart_dart-core/List.html">List</a> class.</td></tr><tr><td><a href="/api/Dart_dart-collection/MapMixin.html">MapMixin&lt;K, V&gt;</a></td><td>Mixin implementing a <a href="/api/Dart_dart-core/Map.html">Map</a>.</td></tr><tr><td><a href="/api/Dart_dart-collection/SetMixin.html">SetMixin&lt;E&gt;</a></td><td>Mixin implementation of <a href="/api/Dart_dart-core/Set.html">Set</a>.</td></tr></tbody></table>',24)])])}const f=e(l,[["render",o]]);export{m as __pageData,f as default};
